import React from 'react';
import Link from 'next/link';


class Home extends React.Component {

    render() {
        return (
            <>
                <p>Home Page!</p>

                <Link href="/sell">
                    <a>Go to Sell</a>
                </Link>
            </>

        );
    }
}

export default Home;
